import React from 'react';
import ReactDOM from 'react-dom';
import Cards from './Cards';
import Sdata from './Sdata';


ReactDOM.render(
  <>

  {
    Sdata.map(function(val){
      return(
        <Cards
    snam = {Sdata[val].sname}
    titl = {Sdata[val].title}
  />
      )
    })
  }


  </>,document.getElementById('root')

  );
